import React from 'react';
import { connect } from 'react-redux';

class GoogleAuth extends React.Component {
	componentDidMount() {}

	render() {
		return (
			<button className="ui button">
				<i className="fab fa-google" /> Sign in
			</button>
		);
	}
}

export default connect(null, {})(GoogleAuth);
